import React from "react";
import { Switch, Router, Route, Redirect, useLocation, useHistory } from "react-router-dom";
import Header from "./components/Header";
import Product from "./components/Product";
import Home from "./components/Home";
import About from "./components/About";
import Footer from "./components/Footer";

function Routes() {
    const location = useLocation();

    return (
        <>
        <Suspense fallback="...Loading">
            <>
            <Header />
              <Switch>
                <RouteOpen exact path="/" component={Home} />
                <RouteOpen exact path="/about" component={About} />
                <RouteOpen exact path="/product" component={Product} />
              </Switch>
              <Footer />
            </>
        </Suspense>
        </>
    )
}


const RouteProtected = ({ auth, loading, component: Component, ...rest }) => {
    // const authApi = useContext(AuthApi);
    const history = useHistory();
    // const authApi = useContext(AuthApi);

    //console.log(auth); //error har med redux och cookie duration att göra? Kolla chrome cookies

    //authApi is null the first tries before getting true
    return (
        <Route
          { ...rest }
          render={props =>
            !loading
              ?
                (
                  auth
                  ?
                  <Component {...props} />
                  :
                  <Redirect to="/login" />
                )
              :
                <p>Loading...</p>
          }
        />
    )
}

const RouteOpen = ({component: Component, ...rest }) => {

    return (
        <Route
          { ...rest }
          render={props =>
            <Component {...props} />
          }
        />
        )
}

export default Routes;
